  false,\n\t\"url\": null,\n\t\"notes\": \"This Comprehensive Conservation Plan (CCP)
  was written to guide management on Texas Chenier Plains Refuge Complex for the next
  15 years. This plan outlines the Complex vision and purpose and describes how Texas
  Chenier Plains Refuge Complex will contribute to the overall mission of the Refuge
  System. The plan provides an introduction to the Complex, an overview of the CCP
  process, alternatives, the affected environment, an environmental impact analysis,
  and coordination and consultation. Key planning issues include: expansion of the
  Complex, recreational uses, habitat management, restoration of Refuge lands, and
  threats to the ecosystem.\",\n\t\"license_title\": \"License Not Specified\",\n\t\"extras\":
